from api.category_api import CategoryViewSetfrom api.location_api import LocationViewSetfrom api.service_api import ServiceViewSetfrom api.order_api import OrderViewSetfrom api.schedule_api import ScheduleViewSetfrom rest_framework.routers import DefaultRouterrouter = DefaultRouter()router.register('category', CategoryViewSet)router.register('location', LocationViewSet)router.register('service', ServiceViewSet)router.register('order', OrderViewSet)router.register('schedule', ScheduleViewSet)urlpatterns = router.urls